import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Portfolio from './pages/Portfolio';
import './App.css';

function App() {
  return (
    <Switch>
      <Route exact path="/" component={Portfolio} />
    </Switch>
  );
}

export default App;
